// src/pages/ProtectionKits.jsx
import useArmouryData from "../hooks/useArmouryData";

export default function ProtectionKits() {
  const kits = useArmouryData("protectionKits");
  return (
    <div className="p-10">
      <h2 className="text-2xl mb-6">Armoury: Protection Kits</h2>
      <ul>
        {kits.map((kit, idx) => (
          <li key={idx} className="mb-4 bg-green-200 p-4 rounded shadow">
            <span className="text-xl font-semibold">{kit.name}</span>
            <span className="ml-4 text-gray-700">Protection: {kit.protection}</span>
          </li>
        ))}
      </ul>
    </div>
  );
}
